import React from "react";
import Classes from "../component/CourseList.jsx";
import Mine from "../component/AccountInfo.jsx";
import { BrowserRouter, Link, Route, Switch } from "react-router-dom";

function Tutorial() {
  return (
    <div>
      intruduction of this app
      <p>
        you can login first, and put your courses, your questions and your
        answers here
      </p>
    </div>
  );
}

class HomepageGuide extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div>
        <ul>
          <li>
            <Link to="/">Home PAge</Link>
          </li>
          <li>
            <Link to="/classes">My Classes</Link>
          </li>
          <li>
            <Link to="/mine">My Accounts</Link>
          </li>
          <li>
            <Link to="/mineaaaa">Empty</Link>
          </li>
        </ul>
        {/* 路由配置 */}
        <Switch>
          <Route exact path="/" component={Home}></Route>
          <Route path="/classes" component={Classes}></Route>
          <Route path="/mine" component={Mine}></Route>
          {/* 配置404组件 */}
          <Route component={Notfound}></Route>
        </Switch>
      </div>
    );
  }
}

export default class Home extends React.Component {
  constructor(props) {
    super(props);
  }
  render() {
    return (
      <>
        <div>
          <header>Home Page</header>
        </div>
        <hr />
        <Tutorial />
        <BrowserRouter>
          <HomepageGuide />
        </BrowserRouter>
      </>
    );
  }
}

function Notfound() {
  return <div>404page</div>;
}
